REGRAS DO GRUPO
@Patria_News December 06, 2022

— Aqui estão algumas diretrizes simples para a convivência neste grupo, portanto 
É ESTRITAMENTE PROIBIDO 👇 
1. FAKE NEWS/INFORMAÇÕES ANTIGAS;
❗️ Punição: Advertência 
2. POSTAGEM/ÁUDIOS DE ANA PRISCILA AZEVEDO;
❗️ Punição: Advertência 
3. COMENTÁRIOS ESTRANHOS/DESESTIMULANTE;
❗️ Punição: Advertência 
4. PEDIDOS DE PIX;
❗️ Punição: Ban 🚷
5. COMENTÁRIOS QUE GEREM DESCONFORTO/PÂNICO NO GRUPO;
❗️ Punição: Advertência
6. MOVIMENTAÇÃO DO EXÉRCITO SOMENTE COM DATA E LOCAL, SEM ISSO PODE SER ANTIGO;
❗️ Punição: Advertência
7. PUBLIQUE SOMENTE VÍDEOS DE MANIFESTAÇÕES COM DATA EM ÁUDIO. 
❗️ Punição: O Vídeo será apagado
8. AFRONTAS SEJA CONTRA O GRUPO, ADMIN OU ENTRE MEMBROS NÃO SERÃO TOLERADAS;
❗️ Punição: Ban 🚷
9. É PROIBIDA A DIVULGAÇÃO DE GRUPOS E CANAIS DO TELEGRAM, OU DE OUTRAS REDES, SEM AUTORIZAÇÃO PRÉVIA DA MODERAÇÃO;
❗️ Punição: Advertência 
10. ANTES DE POSTAR, CONFIRME SE A INFORMAÇÃO É VERÍDICA;
11. NÃO ENVIE LINKS PARA MEMBROS NO PRIVADO. CASO RECEBA LINKS SUSPEITOS OU DE DIVULGAÇÃO INDEVIDA DE ALGUM MEMBRO DO GRUPO, FAVOR AVISAR A MODERAÇÃO EM Ala Vip  . 

❗️ATENÇÃO ❗️
— A escolha das punições para quem infringir o regulamento e a duração das mesmas fica ao total arbítrio de quem as aplica! 
— Os administradores assumem o direito de poder decidir se aplicam uma punição menor, igual ou maior à descrita aqui no regulamento, de acordo com um critério decidido internamente de poder aplicar uma restrição aos usuários que realizam qualquer tipo de comportamento não adequado ao sossego do grupo e não descrito neste regulamento.
